import React, { Fragment } from 'react';
import logo from '../Media/logo.png'
import Search from './Search';
import { useState } from "react";

function Nav(params) {
    const [trac, settrac] = useState(false);
    const open=()=>{
      settrac(true);
      console.log("openn");
    }
    const close=()=>{
        settrac(false);
        console.log("close");
    }
    return(
        <Fragment>
        <nav>
            <div>
               <div> <img src={logo} alt="" /></div>
               <div>
                <ul>
                    <li>Products</li>
                    <li>For Teams</li>
                    <li>Support</li>
                </ul>
                </div>
            </div>
            <div className='div2'>
                <button onClick={trac ?close:open}><i className='fa fa-search'></i></button>
                <button className='login'>LogIn</button>
                <button className='signup'>SignUp</button>
                <button><i className='fa fa-bars'></i></button>

            </div>
        </nav>
        {trac && <Search/> }

        </Fragment>
    );

};export default Nav;
